import './navitem.css'

function NavItem(props){
    function onMouseOver(event){
        event.target.childNodes[0].childNodes[0].classList.add("active")
    }
    return(
        <div className='NavItem-wrapper' onMouseMove={onMouseOver}>
            {props.icon}
            <label>{props.title}</label>
        </div>
    );
}

export default NavItem;
